def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    priorities = np.zeros_like(bins)

    for i in range(len(bins)):
        if item > bins[i]:
            priorities[i] = 0
        else:
            remaining_space = bins[i] - item
            utilization_ratio = remaining_space / bins[i]

            if utilization_ratio < 0.05:
                priority_score = 1 / (1 + utilization_ratio)
            elif utilization_ratio >= 0.05 and utilization_ratio < 0.2:
                priority_score = 0.8 / (1 + utilization_ratio)
            elif utilization_ratio >= 0.2 and utilization_ratio < 0.4:
                priority_score = 0.6 / (1 + utilization_ratio)
            elif utilization_ratio >= 0.4 and utilization_ratio < 0.6:
                priority_score = 0.4 / (1 + utilization_ratio)
            else:
                priority_score = 0.2 / (1 + utilization_ratio)

            if remaining_space >= 7:
                priority_score *= 1.3
            elif remaining_space >= 4:
                priority_score *= 1.15

            if bins[i] >= 20:
                priority_score *= 1.5
            elif bins[i] >= 15:
                priority_score *= 1.4
            elif bins[i] >= 10:
                priority_score *= 1.2

            if item < 7:
                priority_score += 0.3
            elif item >= 7 and item < 12:
                priority_score += 0.15
            elif item >= 12 and item < 17:
                priority_score += 0.1

            if bins[i] < 7:
                priority_score += 0.2
            elif bins[i] >= 7 and bins[i] < 12:
                priority_score += 0.1

            priorities[i] = priority_score

    return priorities
